INSERT INTO `` (`id`,`userId`,`heading`,`content`,`created`,`lastEdited`,`softDelete`) VALUES (7,10,'Mans mansplaining','<p>\"M&ouml;t Mans M&aring;nsson, mannen som inte bara har en &aring;sikt om allt, utan ocks&aring; tror att hans &aring;sikt &auml;r den enda som spelar roll. Han &auml;r som en encyklopedi &ouml;ver sj&auml;lv&ouml;verskattning och &ouml;verdrivet sj&auml;lvf&ouml;rtroende.\"</p>\n<p>\"<span style=\"background-color: rgb(236, 202, 250);\">Mans M&aring;nsson, mannen som tror att han kan f&ouml;rklara saker f&ouml;r dig &auml;ven n&auml;r du redan vet mer &auml;n honom. Han &auml;r som en GPS som</span> envisas med att dirigera dig till platser du redan befinner dig p&aring;.\"</p>\n<p>\"<span style=\"background-color: rgb(241, 196, 15);\">Mans M&aring;nsson &auml;r den perfekta kombinationen av &ouml;vertygande och oinformerad. Han tror att han &auml;r en guru inom alla &auml;mnen, men i verkligheten &auml;r han mer som en amat&ouml;rkock som tror att han kan l&auml;ra en Michelin-kock hur man lagar mat.\"</span></p>\n<p>\"Mans M&aring;nsson, mannen som tror att han &auml;r en hj&auml;lte f&ouml;r att han delar med sig av sina visdomsord till kvinnor. Han &auml;r som en supersoldat i sitt eget sinne, men f&ouml;r resten av v&auml;rlden &auml;r han mest en komisk karakt&auml;r.\"</p>\n<p>\"Mans M&aring;nsson, den o&ouml;vertr&auml;ffade m&auml;staren av att f&ouml;rklara saker p&aring; ett s&auml;tt som f&aring;r dig att undra om han ens lyssnar p&aring; sig sj&auml;lv. Han &auml;r som en stand-up komiker vars sk&auml;mt alltid faller platt, men han skrattar &auml;nd&aring; &aring;t dem sj&auml;lv.\"</p>','2024-02-22 19:02:15','2024-02-22 19:04:51',NULL);
