INSERT INTO `` (`id`,`userId`,`heading`,`content`,`created`,`lastEdited`,`softDelete`) VALUES (10,1,'notes22','<p>Det var en g&aring;ng en hammarhaj vid namn Herman, som bodde i det <span style=\"background-color: rgb(194, 224, 244);\">glittrande bl&aring;a </span>havet. Till skillnad fr&aring;n de flesta hajar hade Herman en mycket konstig avsky - han avskydde bananer! Varje g&aring;ng han simmade f&ouml;rbi en banan i havet skulle han snabbt v&auml;nda om och simma &aring;t andra h&aring;llet. Hans v&auml;nner fann det b&aring;de lustigt och f&ouml;rbryllande.</p>\n<p>En dag simmade Herman runt och letade efter sitt favoritbyte n&auml;r han pl&ouml;tsligt st&ouml;tte p&aring; en stor klunga bananer som fl&ouml;t i vattnet. Han ryggade tillbaka och skakade p&aring; huvudet i f&ouml;rakt. \"Usch, bananer!\" mumlade han f&ouml;r sig sj&auml;lv och simmade iv&auml;g s&aring; fort han kunde.</p>\n<p>Herman f&ouml;rs&ouml;kte undvika bananerna s&aring; gott det gick, men ibland var de &ouml;verallt. Hans v&auml;nner b&ouml;rjade reta honom och kalla honom \"Herman, banan-fobikern\". Trots deras sk&auml;mt kunde Herman inte &ouml;vervinna sin avsky f&ouml;r <span style=\"background-color: rgb(241, 196, 15);\">bananer.</span></p>\n<p>Trots hans avsky f&ouml;r bananer var Herman fortfarande en mycket &auml;lskad och respekterad hammarhaj i det bl&aring;a havet. Och &auml;ven om bananer var hans st&ouml;rsta fobi, hindrade det honom inte fr&aring;n att njuta av sitt liv bland korallreven och fiskarna i sitt vackra hem.</p>','2024-02-23 19:49:53','2024-02-23 20:22:53',NULL);
